This is a 1997 book by Suelette Dreyfus, researched by Julian Assange. It describes the exploits of a group of Australian, American, and British black hat hackers during the late 1980s and early 1990s, among them Assange himself. The book has been available for free since 2001 (currently at the address below) and this is a PDF edition of it.
